import React from "react";
import styled from "styled-components";
import {Link} from 'react-router-dom'

const TextDiv = styled.div`
  position: absolute;
  left: 35px;
  top: 90px;
  white-space: nowrap;
  font-family: "Noto Sans";
  font-style: normal;
  font-weight: 600;
  font-size: 25px;
  line-height: 34px;
`;

const ScrollDiv = styled.div`
  margin-top: 160px;
  margin-left: 35px;
  overflow: scroll;

  /* 가로 스크롤 */
  overflow: auto;
  white-space: nowrap;

  ::-webkit-scrollbar {
    display: none;
  }
`;

const MenuDiv = styled.div`
  display: inline-block;
  width: 54px;
  height: 54px;
  background: #ffffff;
  border: 2px solid #4c88ff;
  border-radius: 50%;
  text-align: center;
  line-height: 54px;
  margin-right: 10px;

  font-family: Noto Sans;
  font-size: 15px;
  font-weight: 600;
`;

const Project = () => {
  return (
    <div>
      <TextDiv>프로젝트</TextDiv>
      <ScrollDiv>
        <MenuDiv><Link to="/">전체</Link></MenuDiv>
        <MenuDiv><Link to="/6thProj">6기</Link></MenuDiv>
        <MenuDiv><Link to="/5thProj">5기</Link></MenuDiv>
        <MenuDiv><Link to="/4thProj">4기</Link></MenuDiv>
        <MenuDiv><Link to="/3thProj">3기</Link></MenuDiv>
        <MenuDiv><Link to="/2thProj">2기</Link></MenuDiv>
        <MenuDiv><Link to="/">1기</Link></MenuDiv>
      </ScrollDiv>

    </div>
  );
};

export default Project;
